import React from 'react'
import FeedbackItem from './components/FeedbackItem'

export default function FeedbackList({data}) {
  return (
    <>
    {data.map((item =>{
        return (
            <div><FeedbackItem data={data} text={item.text}/></div>
        )

    }))}

    </>

 )
}
